import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    createStyles,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Theme,
    withStyles,
    WithStyles,
} from '@material-ui/core';
import _ from 'lodash';
import employees from '../data/employees.json';
//import classes from '*.module.css';

export interface IState {
    apiurl: string;
    datarecords: any[];
    datacolumns: any[];
}

export default class FetchTableData extends React.Component{

    //constructor(props:IState) {
    //    super(props);
    //    this.state = {
    //        apiurl:'',
    //        datarecords: [],
    //        datacolumns: [],
    //    }
    //}

    state = {
        datarecords: [],
    }

    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/users')
            .then(response => {

                this.setState({ datarecords: response.data });
                console.log(this.state.datarecords);
             
            })
            .catch(error => {

            })
    }

    
    render() {
        const datarecords = this.state.datarecords;
        const list = this.state.datarecords.map(user => (
            <div key={user.id}>
                <div>{user.id}</div>
            </div>
        ));
        return(
        <Paper >
            <p>Employee List</p>

            <Table >
                    <TableHead>

                    <TableRow>
                        <TableCell>Id</TableCell>
                        <TableCell>Employee Name</TableCell>
                        <TableCell>Salary</TableCell>
                        <TableCell>Age</TableCell>
                    </TableRow>
                </TableHead>
                    <TableBody>
                        {datarecords.map(row => {
                            return (

                                <TableRow key={row.id}>
                                    <TableCell>{row.id}</TableCell>
                                    <TableCell>{row.employee_name}</TableCell>
                                    <TableCell>{row.employee_salary}</TableCell>
                                    <TableCell>{row.employee_age}</TableCell>
                                </TableRow>
                            );
                        })}
                    </TableBody>   
            </Table>
        </Paper>
            
        );
    }
}
